tables.table_schema:
CREATE TABLE social_media_engagement_metrics (
    id INT PRIMARY KEY,
    influencer_name VARCHAR(255),
    follower_count INT,
    engagement_rate FLOAT
);

CREATE TABLE influencer_partnerships (
    id INT PRIMARY KEY,
    influencer_name VARCHAR(255),
    partnership_start_date DATE,
    partnership_end_date DATE
);

CREATE TABLE influencers (
    id INT PRIMARY KEY,
    name STRING,
    followers_count INT,
    engagement_rate FLOAT
);

CREATE TABLE engagements (
    engagement_id INT PRIMARY KEY,
    post_id INT,
    engagement_type STRING,
    engagement_time TIMESTAMP
);

CREATE TABLE influencers (
  influencer_id INT PRIMARY KEY,
  influencer_name VARCHAR(100),
  followers_count INT,
  engagement_rate FLOAT
);

CREATE TABLE posts (
  post_id INT PRIMARY KEY,
  post_date DATE,
  post_content TEXT,
  influencer_id INT
);

CREATE TABLE likes (
  like_id INT PRIMARY KEY,
  post_id INT,
  user_id INT,
  like_date DATETIME
);
